import React from 'react';
import SignInForm from './components/signInForm';

class SignedOutMain extends React.Component {

    render() {
        if(this.props.openForm){
            return <SignInForm logIn={this.props.logIn}/>
        } else return null;
    }
}

export default SignedOutMain;
